import { Route, Routes } from 'react-router-dom'
import './App.css';
import Navbar from './components/Navbar/Navbar'
import ListCards from './components/ListCards/ListCards'


function App() {
    return (
        <main className="App">
            <Navbar />


            <div className='container'>
                <div className='row'>
                    <ListCards />
                </div>
            </div>


        </main>
    )
}
export default App;
